import React  from "react"
import "./table.css"

const addRow = (rows, header) => {
    const output = [];
    let pos = 1;
    for (const row in rows) {
       // adding rows
        output.push(<tr>
            <td> {pos} </td>
            {header.map(val => <td> {row[val]} </td>)}
            <td class="show-details" id={`${row[header[0]]}-show-details`}>
                [show details]
            </td>
        </tr>);
        //adding projects
        row.push( <tr>
            <td className="extra" colSpan="3">
               <div className="log">
                    <ul>
                        {row.Projects.map(project => <li> {project} </li>)}
                    </ul>
                </div>
             </td>
        </tr>);
        pos++;
    } 
    return output;    
}



const Table = (props) => 
<div id={props.title}>
    <h1>          
        <i className={props.icon} />
        {props.title} 
    </h1>
    <table>
        <tr>
            <th> # </th>
            {props.header.map(val => <th> {val} </th>)}
            <th> </th>
        </tr>
        {

         addRow(props.details, props.header)   
        }
    </table>
</div>

export default Table;
